import React from "react";

function Logo() {
    return (
      <div>
        <a href="#">
          <div className="logo-wrap">
            <div 
              id="logo" 
              className='logo' 
              alt="Brand logo"
              >
              LMS
            </div>
          </div>
        </a> 
      </div>
    );
  }
  export default Logo;
